import React from 'react'

function Activity() {
  return (
    <div style={{textAlign:'center'}}>
<h3>About Us</h3>
<p>This list of free movie apps will put thousands of free streaming movies at your fingertips. Install them on your smartphone or tablet, and you'll be ready to watch the film of your choice no matter where you go.
  <br/>Not only do these apps stream movies, but many also let you watch free TV shows. This is a great way to catch up on your favorite shows when you're on the go. 
  <br/> The titles you can access from these apps include comedy movies, action movies, horror movies, dramas, documentaries, and family films. There really is something for everyone.
  </p>
    </div>
  )
}

export default About
